/// Converts to a basic Material ColorScheme.
/// Note: This is only as a fallback for Material widgets,
///       prefer using the theme extension properties.
extension ColorSchemeExtension on DSColorThemeExtension {
  ColorScheme toColorScheme({
    Brightness brightness = Brightness.light,
  }) {
    ColorScheme colorScheme = Brightness.light == brightness
      ? ColorScheme.light()
      : ColorScheme.dark();

    return colorScheme.copyWith(
      primary: surfaceNeutralBackgroundLight,
      onPrimary: textNeutralOnWhite,
    );
  }
}